import React from "react";

function Contect() {
  return (
    <div className="contectUs">
      <div className="formWrapper">
        <div className="name">
          <lable>Name</lable>
          <input type="text" name="name" id="name" />
        </div>
        <div className="phone">
          <lable>Name</lable>
          <input type="pho" name="phone" id="phone" />
        </div>
        <div className="name">
          <lable>Name</lable>
          <input type="text" name="name" id="name" />
          <input type="password" name="" id="" />
        </div>
      </div>
    </div>
  );
}

export default Contect;
